def revc(s):
    # use dictionary to find the reverse compliment
    reverseCompDict = {"A":"T", "T":"A", "C":"G", "G":"C"}
    reverseComp = ""
    for nucleotide in s:
        reverseComp += reverseCompDict[nucleotide]
    reverseComp = reverseComp[::-1] # reverse string
    return reverseComp

print(revc(""))